import React from "react";
import styles from "./Navbar.module.css";
import { NavLink } from "react-router-dom";

const Navbar = () => {
    return (
        <div className={styles.nav}>
            <nav>
                <div className={styles.nav__item}>
                    <NavLink to="/profile" activeClassName={sty}>Profile</NavLink>
                </div>
                <div className={styles.nav__item}>
                    <NavLink to="/dialogs" activeClassName={sty}>Messages</NavLink>
                </div>
                <div className={styles.nav__item}>
                    <NavLink to="/news" activeClassName={sty}>News</NavLink>
                </div>
                <div className={styles.nav__item}>
                    <NavLink to="/music" activeClassName={sty}>Music</NavLink>
                </div>
                <div className={styles.nav__item}>
                    <NavLink to="/settings" activeClassName={sty}>Settings</NavLink>
                </div>
            </nav>
        </div>
    );
};

export default Navbar;
